import React from 'react'
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
const options = {
    
    chart: {
        type: 'spline'
      },
    title: {
      text: 'My chart'
    },
    xAxis      : { 
        min:Date.UTC(2020, 0, 0),
        max:Date.UTC(2020, 11, 1),
        allowDecimals: false,
        type           : 'datetime',
        tickInterval   : 24 * 3600 * 1000*30, //one day
        labels         : {
            rotation : 0
        }
    },
    series: [{
        data: [
            {        
              type: "line",
              dataPoints: [
              { x: 10, y: 21 },
              { x: 20, y: 25},
              { x: 30, y: 20 },
              { x: 40, y: 25 },
              { x: 50, y: 27 },
              { x: 60, y: 28 },
              { x: 70, y: 28 },
              { x: 80, y: 24 },
              { x: 90, y: 26}
            
              ]
            },
              {        
              type: "line",
              dataPoints: [
              { x: 10, y: 31 },
              { x: 20, y: 35},
              { x: 30, y: 30 },
              { x: 40, y: 35 },
              { x: 50, y: 35 },
              { x: 60, y: 38 },
              { x: 70, y: 38 },
              { x: 80, y: 34 },
              { x: 90, y: 44}
            
              ]
            },
              {        
              type: "line",
              dataPoints: [
              { x: 10, y: 45 },
              { x: 20, y: 50},
              { x: 30, y: 40 },
              { x: 40, y: 45 },
              { x: 50, y: 45 },
              { x: 60, y: 48 },
              { x: 70, y: 43 },
              { x: 80, y: 41 },
              { x: 90, y: 28}
            
              ]
            },
              {        
              type: "line",
              dataPoints: [
              { x: 10, y: 71 },
              { x: 20, y: 55},
              { x: 30, y: 50 },
              { x: 40, y: 65 },
              { x: 50, y: 95 },
              { x: 60, y: 68 },
              { x: 70, y: 28 },
              { x: 80, y: 34 },
              { x: 90, y: 14}
            
              ]
            }
            ]
    }]
  }
class LineChart1 extends React.Component{
    constructor(){
        super()
    }
render(){
    return(
        <div>
  <HighchartsReact
    highcharts={Highcharts}
    options={options}
  />
        </div>
    )
}
}
export default LineChart1
